css:
.fb-on-demand-view-wrapper {
  display: flex;
  flex: 1;
}
.fb-on-demand-view {
  overflow: scroll;
  width: 100%;
  position: relative;
  background: #21252b;
  padding: 10px;
}
.fb-on-demand-refresh-button-container {
  z-index: 1;
  right: 0;
  padding: 10px;
  position: absolute;
}
.fb-on-demand-spinner {
  margin-left: 50%;
  margin-top: 25%;
}
.fb-on-demand-view-header {
  border-bottom: 1px solid #181a1f;
  margin-bottom: 10px;
}
.fb-on-demand-view-header h1 {
  font-size: 1.6em;
  font-weight: bold;
  color: white;
  display: inline-block;
}
.fb-on-demand-view-header button {
  float: right;
}
